import React, { Component } from 'react'
import Layout from '../pages/Layout'

export class Footer extends Component {
   

    render() {
        return (
            <div>
                <Layout>
                <h1>Footer</h1>
                </Layout>
            </div>
        )
    }
}

export default Footer
